import React from "react";

const BookMark = ({ status }) => {
  <span>
    {status === false ? (
      <i class="bi bi-bookmark"></i>
    ) : (
      <i class="bi bi-bookmark-fill"></i>
    )}
  </span>;
};

export default BookMark;
